@-moz-document domain("youtube.com") {
* {background-img: http://www.monalbum.fr/GroteFoto-IBGVJJG6.jpg}
a, li > a.title, li > a > span.title {color: #E0FFFF  !important;} 
h1, h2, h3, h4, h5, h6 {color: #000000  !important;} 
